package blog.utils;


import lombok.extern.slf4j.Slf4j;
import org.apache.tomcat.util.codec.binary.Base64;

import java.io.FileOutputStream;
import java.io.IOException;
import java.time.LocalDateTime;
import java.time.format.DateTimeFormatter;
import java.util.Locale;

/**
 * @author ZGB
 * @version 1.0
 * @description: 图片操作工具类
 * @date 2022/11/9 22:21
 */
@Slf4j
public class ImgUtil{

	private static final String IMGPATH = "static\\imgs";

	public static String storageBase64Img(String base64Data,String author) throws IOException {

		String projectPath = System.getProperty("user.dir");
		// 截取图片信息
		String[] info = base64Data.split(";base64,");
		// 截取图片文件后缀
		String fileSuffix = info[0].substring(11);
		// 图片数据
		String base64ImgData = info[1];
		DateTimeFormatter dtf = DateTimeFormatter.ofPattern("yyyyMMddHHmmssSS", Locale.US); // 格式化时间
		String date = dtf.format(LocalDateTime.now());
		// 文件名
		String fileName = date + "_" + author;


		String imgPath = projectPath +"\\src\\main\\resources\\" + IMGPATH + "\\" + fileName+"."+fileSuffix;
		String reaPath = IMGPATH + "\\" + fileName+"."+fileSuffix;
		byte[] bs = Base64.decodeBase64(base64ImgData);

		try (FileOutputStream fos = new FileOutputStream(imgPath)){
			fos.write(bs);
			fos.flush();
			log.info("图片保存成功"+imgPath);
		} catch (Exception e) {
			log.info("图片保存异常"+e);
		}
		return reaPath;
	}

	public static void tmain(String[] args) {
		String s1 = "data:image/jpeg;base64,";
		String s2 = "";
		String base64ImgStr = s1+s2;
		try {
			String path = ImgUtil.storageBase64Img(base64ImgStr,"2020");
			System.out.println(path);
		}catch (Exception e){
			e.printStackTrace();
		}

	}
}
